create database imdb_db;

use imdb_db;

create table movie
(
id	varchar(20) primary key,
title	varchar(100),
Year	int,
date_published	date,
duration	int,
country	varchar(200),
worlwide_gross_income	varchar(20),
languages	varchar(200),
production_company	varchar(200)
);

Select * from movie limit 5;

create table genre
(
movie_id	varchar(20),
genre	varchar(50)
);

create table director_mapping
(
movie_id	varchar(20),
name_id	varchar(20)
);

Create table role_mapping
(
movie_id	varchar(20),
name_id	varchar(20),
category	varchar(20)
);

create table names
(
id	varchar(20) primary key,
name	varchar(100),
height	int,
date_of_birth	date,
known_for_movies	varchar(100)
);

create table ratings
(
movie_id	varchar(20) primary key,
avg_rating	DECIMAL(5, 2),
total_votes	int,
median_rating	int
);

ALTER TABLE role_mapping
ADD PRIMARY KEY (movie_id, name_id);

ALTER TABLE genre
ADD PRIMARY KEY (movie_id, genre);

ALTER TABLE director_mapping
ADD PRIMARY KEY (movie_id, name_id);

ALTER TABLE genre
ADD CONSTRAINT genre_fn
FOREIGN KEY (movie_id) REFERENCES movie (id);

ALTER TABLE ratings
ADD CONSTRAINT ratings_fn
FOREIGN KEY (movie_id) REFERENCES movie (id);

ALTER TABLE director_mapping
ADD CONSTRAINT director_fn
FOREIGN KEY (movie_id) REFERENCES movie (id);

ALTER TABLE role_mapping
Add FOREIGN KEY (name_id) REFERENCES names (id),
Add FOREIGN KEY (movie_id) REFERENCES movie (id);

ALTER TABLE director_mapping
ADD CONSTRAINT ratings_name_fn
FOREIGN KEY (name_id) REFERENCES names (id);











